pragma solidity >=0.8.0 <0.9.0;

abstract contract Ownable {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor() {
        _changeOwner(msg.sender);
    }
    modifier onlyOwner() {
        require(_owner == msg.sender, "Ownable: caller is not the owner");
        _;
    }
    function owner() public view virtual returns (address) {
        return _owner;
    }
    function renounceOwnership() public virtual onlyOwner {
        _changeOwner(address(0));
    }
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
    function _changeOwner(address newOwner) internal virtual {
        address old = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(old, newOwner);
    }
}

interface IERC20 {
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
}

interface IERC165 {
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}

interface IERC1155 is IERC165 {
    event TransferSingle(address indexed operator, address indexed from, address indexed to, uint256 id, uint256 value);
    event TransferBatch(
        address indexed operator,
        address indexed from,
        address indexed to,
        uint256[] ids,
        uint256[] values
    );
    event ApprovalForAll(address indexed account, address indexed operator, bool approved);
    event URI(string value, uint256 indexed id);
    function balanceOf(address account, uint256 id) external view returns (uint256);
    function balanceOfBatch(
        address[] calldata accounts,
        uint256[] calldata ids
    ) external view returns (uint256[] memory);
    function setApprovalForAll(address operator, bool approved) external;
    function isApprovedForAll(address account, address operator) external view returns (bool);
    function safeTransferFrom(address from, address to, uint256 id, uint256 amount, bytes calldata data) external;
    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] calldata ids,
        uint256[] calldata amounts,
        bytes calldata data
    ) external;
}

interface IERC721 is IERC165 {
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    function balanceOf(address owner) external view returns (uint256 balance);
    function ownerOf(uint256 tokenId) external view returns (address owner);
    function safeTransferFrom(address from, address to, uint256 tokenId, bytes calldata data) external;
    function safeTransferFrom(address from, address to, uint256 tokenId) external;
    function transferFrom(address from, address to, uint256 tokenId) external;
    function approve(address to, uint256 tokenId) external;
    function setApprovalForAll(address operator, bool approved) external;
    function getApproved(uint256 tokenId) external view returns (address operator);
    function isApprovedForAll(address owner, address operator) external view returns (bool);
}

interface InterfaceAneemate is IERC721 {
    function mintTo(address to, address royaltyReceiver, bytes memory geneCode) external;
    function allowTransfers() external;
    function totalSupply() external view returns (uint256);
}

contract BuyAneemateGenesis is Ownable{

    address public aneemateContractAddr;
    address public whitelistContractAddr;
    uint64 public guranteedMintStart;
    uint64 public whitelistMintStart;
    uint64 public publicMintStart;
    uint64 public mintEnd;
    uint256 public mintPrice;
    uint32 public mintLimit = 3000;
    mapping (address => bool) guranteedMint;
    


    constructor(address anneemateContractAddr_, address whitelistContractAddr_,
     uint64 guranteedMintStart_, uint64 whitelistMintStart_, uint64 publicMintStart_, uint64 mintEnd_, uint256 mintPrice_, address[1030] memory guranteed){
        aneemateContractAddr = anneemateContractAddr_;
        whitelistContractAddr = whitelistContractAddr_;
        guranteedMintStart = guranteedMintStart_;
        whitelistMintStart = whitelistMintStart_;
        publicMintStart = publicMintStart_;
        mintEnd = mintEnd_;
        mintPrice = mintPrice_;
        for (uint16 i; i<1030; i++){
            guranteedMint[guranteed[i]] = true;
        }
    }

    function totalSupply() public view returns(uint256){
        return InterfaceAneemate(aneemateContractAddr).totalSupply();
    }

    function balanceOf(address owner) public view returns(uint256){
        return InterfaceAneemate(aneemateContractAddr).balanceOf(owner);
    }


    function _mintAneemate(uint16[5] memory variants, uint16 amount, InterfaceAneemate aneemateSC) internal {   
        for(uint16 i=0; i<amount; i++){
            require(variants[i] <= 17, "AneemateGenesisMint: Invalid variant!");
            bytes memory geneCode = abi.encodePacked(variants[i], uint240(0));
            aneemateSC.mintTo(msg.sender, address(0), geneCode);
        }
    }

    function buyGenesisAneemate(uint16[5] memory variants, uint16 amount) public payable {
        require(block.timestamp < mintEnd , "AneemateGenesisMint: Genesis mint has already ended!");
        InterfaceAneemate aneemateSC = InterfaceAneemate(aneemateContractAddr);
        require(aneemateSC.totalSupply()+amount <= mintLimit, "AneemateGenesisMint: Genesis limit reached!");
        require(amount > 0 && amount <= 5, "AneemateGenesisMint: Incorrect amount!");
        require(msg.value >= mintPrice*amount, "AneemateGenesisMint: Insufficient payment!");
        require(aneemateSC.balanceOf(msg.sender)+amount <= 5, "AneemateGenesisMint: Mint limit already reached!");
        if(block.timestamp > publicMintStart){
            _mintAneemate(variants, amount, aneemateSC);
        } else if (block.timestamp > whitelistMintStart && IERC1155(whitelistContractAddr).balanceOf(msg.sender, 1) > 0){
            _mintAneemate(variants, amount, aneemateSC);
        } else if (block.timestamp > guranteedMintStart && guranteedMint[msg.sender] == true){
            _mintAneemate(variants, amount, aneemateSC);
        } else{
            revert("AneemateGenesisMint: You are not eligible for mint!");
        }
        if(aneemateSC.totalSupply() >= mintLimit){
            aneemateSC.allowTransfers();
        }
    }

    function withdraw(address contractAddress, uint256 amount)
    public
    onlyOwner
    {
        if (contractAddress == address(0)) {
            payable(msg.sender).transfer(amount);
        } else {
            if (amount == 0)
                amount = IERC20(contractAddress).balanceOf(address(this));
            IERC20(contractAddress).transfer(msg.sender, amount);
        }
    }



}
